package org.fouryouandme.researchkit.result

import org.threeten.bp.ZonedDateTime

/**
 * The StepResult class represents a result produced by a step
 *
 * A step result is typically generated by the framework as the task proceeds.
 *
 * @property identifier unique id for this result
 *
 */
open class StepResult(
    val identifier: String,
    val startDate: ZonedDateTime,
    val endDate: ZonedDateTime
)